import React from "react";
import "./MainImg.css";
import Carousel from "react-bootstrap/Carousel";
import ExampleCarouselImage from "./ExampleCarouselImage";
import ImageFiller from 'react-image-filler';

const MainImg = () => {
  return (
    <div>
      <div className="mask">
        <Carousel fade >
          <Carousel.Item className="image-container">
            <ExampleCarouselImage img="https://www.pexels.com/video/a-billboard-in-the-city-2047965/" />
            <Carousel.Caption>
              <h3>First slide label</h3>
              <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item className="image-container"> 
            <ExampleCarouselImage img="https://www.shutterstock.com/image-photo/milan-italy-february-22-2024-woman-2514430479"/>
            <Carousel.Caption>
              <h3>Second slide label</h3>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item className="image-container">
            <ExampleCarouselImage img="https://www.shutterstock.com/image-photo/kharkiv-ukraine-january-22-2023-perfume-2252617007" />
            <Carousel.Caption>
              <h3>Third slide label</h3>
              <p>
                Praesent commodo cursus magna, vel scelerisque nisl consectetur.
              </p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
    </div>
  );
};

export default MainImg;
